import Comp3 from "./Comp3";

function Comp2(props) {
    return (
        <div>
            <h2>Title: {props.title3}</h2>
            <p>Description: {props.description3}</p>

            <h1>Title: {props.title4}</h1>
            <p>Description: {props.description4}</p>

            <Comp3 title2 = 'The Lean Startup'
            description2 = 'A revolutionary approach to building businesses by testing ideas and adapting quickly.'/>            
        </div>
    )
}

export default Comp2
